import React from 'react';
import '../App.css';
import styles, {layout} from "../style";

const Socials = () => {
  return (
    <section id="socials" className={layout.section}>
      <h2 className={`${styles.heading2} flex flex-1`}>Socials:</h2>
      <img src="public/img/instagram.svg" alt="Instagram" />
      <img src="public/img/facebook.svg" alt="Facebook" />
      <img src="public/img/linkedin.svg" alt="LinkedIn" />
      <img src="public/img/spotify.svg" alt="Spotify" />
    </section>
  )
}


export default Socials
